      "body": "\n                   \n\n\n\n\n    Modules\n    AppRoutingModule\n\n\n\n    \n        \n\n\n\n\n\ndependencies\n\nLegend\n\n Declarations\n\n Module\n\n Bootstrap\n\n Providers\n\n Exports\n\ncluster_AppRoutingModule\n\n\n\ncluster_AppRoutingModule_providers\n\n\n\n\nTitleService\n\nTitleService\n\n\n\nAppRoutingModule\n\nAppRoutingModule\n\nAppRoutingModule -->\n\nTitleService->AppRoutingModule\n\n\n\n\n\n\n    \n    \n    \n        Zoom in\n        Reset\n        Zoom out\n    \n\n\n\n\n\n    \n        Info\n    \n    \n        Source\n    \n\n\n\n    \n\n        \n            File\n        \n        \n            src/app/app.routing.module.ts\n        \n\n\n\n\n        \n            \n                \n                    Providers\n                    \n                        \n                            TitleService\n                        \n                    \n                \n            \n        \n\n\n    \n\n\n    \n        import {RouterModule, Routes} from '@angular/router';\nimport {NgModule} from '@angular/core';\nimport {PageNotFoundComponent} from './page-not-found/page-not-found.component';\nimport {ProductDetailsComponent} from './product-details/product-details.component';\nimport {ShoppingCartComponent} from './shopping-cart/shopping-cart.component';\nimport {MyAccountComponent} from './my-account/my-account.component';\nimport {ProductListComponent} from './product-list/product-list.component';\nimport {PaymentComponent} from './payment/payment.component';\nimport {OrderSummaryComponent} from './order-summary/order-summary.component';\nimport {PersonalInfoComponent} from './my-account/personal-info/personal-info.component';\nimport {MyOrdersComponent} from './my-account/my-orders/my-orders.component';\nimport {OrderDetailComponent} from './my-account/order-detail/order-detail.component';\nimport {SupportComponent} from './support/support.component';\nimport {HomePageComponent} from './home-page/home-page.component';\nimport {AuthGuard} from './guards/auth.guard';\nimport {Role} from './models/role.model';\nimport {LoginComponent} from './login/login.component';\nimport {SignUpComponent} from './sign-up/sign-up.component';\nimport {TitleService} from './services/title.service';\n\nconst routes: Routes = [\n  {path: '', redirectTo: '/home', pathMatch: 'full'},\n  {path: 'home', component: HomePageComponent},\n  {path: 'login', component: LoginComponent, data: {title: 'Logowanie'}},\n  {path: 'signup', component: SignUpComponent, data: {title: 'Rejestracja'}},\n  {path: 'products', component: ProductListComponent, data: {title: ' Produkty', animation: 'ProductListPage'}},\n  {path: 'products/:subcategoryId', component: ProductListComponent, data: {animation: 'ProductListPage'}},\n  {path: 'products/category/:categoryId', component: ProductListComponent, data: {animation: 'ProductListPage'}},\n  {path: 'products/detail/:id', component: ProductDetailsComponent, data: {animation: 'ProductDetailsPage'}},\n  {\n    path: 'cart', component: ShoppingCartComponent, canActivate: [AuthGuard],\n    data: {roles: ['ROLE_USER'], title: 'Koszyk'}\n  },\n  {\n    path: 'account', component: MyAccountComponent, canActivate: [AuthGuard],\n    data: {roles: ['ROLE_USER'], title: 'Moje konto'},\n    children: [\n      {path: '', redirectTo: 'personal-info', pathMatch: 'full'},\n      {path: 'personal-info', component: PersonalInfoComponent, data: {title: 'Dane osobowe'}},\n      {path: 'orders', component: MyOrdersComponent, data: {title: 'Zamwienia'}},\n      {path: 'orders/:id', component: OrderDetailComponent}\n    ]\n  },\n  {\n    path: 'payment', component: PaymentComponent, canActivate: [AuthGuard],\n    data: {roles: ['ROLE_USER'], title: 'Skadanie zamwienia'}\n  },\n  {\n    path: 'order-summary', component: OrderSummaryComponent, canActivate: [AuthGuard],\n    data: {roles: ['ROLE_USER'], title: 'Podsumowanie'}\n  },\n  {\n    path: 'support', component: SupportComponent, canActivate: [AuthGuard],\n    data: {roles: ['ROLE_USER'], title: 'Wsparcie'}\n  },\n  {\n    path: 'admin', loadChildren: './admin/admin.module#AdminModule', canActivate: [AuthGuard],\n    data: {roles: ['ROLE_ADMIN', 'ROLE_WORKER'], title: 'Panel administracyjny'}\n  },\n  {path: '**', component: PageNotFoundComponent, data: {title: 'Hurtpol - 404'}}\n];\n\n@NgModule({\n  imports: [\n    RouterModule.forRoot(routes)\n  ],\n  exports: [\n    RouterModule\n  ],\n  declarations: [],\n  providers: [TitleService]\n})\n\nexport class AppRoutingModule {\n}\n\n    \n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n                   \n    \n         result-matching \"\"\n        \n    \n    \n        No results matching \"\"\n    \n\n"
